import React, { useState, useEffect } from 'react';

function matrixToString(matrix) {
  return matrix.map(row => row.join(' ')).join('\n');
}

function stringToMatrix(str, m, n) {
  const nums = str
    .replace(/[^\d\- ]+/g, " ")
    .split(/\s+/)
    .filter(Boolean)
    .map(Number);
  const matrix = [];
  let idx = 0;
  for (let i = 0; i < m; ++i) {
    const row = [];
    for (let j = 0; j < n; ++j) {
      row.push(nums[idx++] ?? -1);
    }
    matrix.push(row);
  }
  return matrix;
}

export default function MatrixInput({ numbers, hWalls, vWalls, setMatrices }) {
  const [m, setM] = useState(numbers.length || 5);
  const [n, setN] = useState(numbers[0]?.length || 5);
  const [numbersText, setNumbersText] = useState(matrixToString(numbers.length ? numbers : Array.from({ length: m }, () => Array(n).fill(-1))));
  const [hWallsText, setHWallsText] = useState(matrixToString(hWalls.length ? hWalls : Array.from({ length: m }, () => Array(n).fill(0))));
  const [vWallsText, setVWallsText] = useState(matrixToString(vWalls.length ? vWalls : Array.from({ length: m }, () => Array(n).fill(0))));

  useEffect(() => {
    setNumbersText(matrixToString(numbers));
    setHWallsText(matrixToString(hWalls));
    setVWallsText(matrixToString(vWalls));
    if (numbers.length && numbers[0].length) {
      setM(numbers.length);
      setN(numbers[0].length);
    }
  }, [numbers, hWalls, vWalls]);

  const handleChange = () => {
    try {
      setMatrices(
        stringToMatrix(numbersText, m, n),
        stringToMatrix(hWallsText, m, n),
        stringToMatrix(vWallsText, m, n)
      );
    } catch (e) {
      // Ignore parse errors for now
    }
  };

  return (
    <div style={{ marginBottom: 24 }}>
      <h2>Step 2: Review/Edit Matrix</h2>
      <div style={{ display: 'flex', gap: 18, flexWrap: 'wrap' }}>
        <div>
          <div><b>Numbers</b> (use -1 for blank):</div>
          <textarea
            rows={m}
            cols={n * 2}
            value={numbersText}
            onChange={e => setNumbersText(e.target.value)}
            onBlur={handleChange}
            style={{ fontFamily: 'monospace', fontSize: 15, minWidth: 120, minHeight: 60 }}
          />
        </div>
        <div>
          <div><b>Horizontal Walls</b> (1=block, 0=open):</div>
          <textarea
            rows={m}
            cols={n * 2}
            value={hWallsText}
            onChange={e => setHWallsText(e.target.value)}
            onBlur={handleChange}
            style={{ fontFamily: 'monospace', fontSize: 15, minWidth: 120, minHeight: 60 }}
          />
        </div>
        <div>
          <div><b>Vertical Walls</b> (1=block, 0=open):</div>
          <textarea
            rows={m}
            cols={n * 2}
            value={vWallsText}
            onChange={e => setVWallsText(e.target.value)}
            onBlur={handleChange}
            style={{ fontFamily: 'monospace', fontSize: 15, minWidth: 120, minHeight: 60 }}
          />
        </div>
      </div>
      <div style={{ marginTop: 8, fontSize: 13, color: "#777" }}>
        Adjust cells if OCR was imperfect.<br />
        <b>Numbers:</b> Use <code>-1</code> for blank.<br />
        <b>Walls:</b> 1 = movement blocked, 0 = allowed.
      </div>
    </div>
  );
}
